import React from 'react';
import { NavLink } from 'react-router-dom';

const Home=()=>{
    return(
        <>
        <section id="header" className="">
        <div className="container-fluid nav_bg">
            <div className="row">
                <div className="col-10 mx-auto">
                    <div className="col-md-6 pt-lg-0 order-2 order-lg-1">
                        <h1>This is my official react website <span>Sagar Jain</span></h1>
                        <h2 className="my-3">First major project for well understanding of using react framework</h2>
                        <div className="mt-3">
                            <NavLink className="btn btn-outline-primary">Get Started</NavLink>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        </section>
        </>
    );
}
export default Home;
